package com.active.bean;import java.io.Serializable;/** * 这是一个类说明 * * @author * @date 2019/10/15 下午8:05 * @since 1.0 */public class RoadExportJdInfo implements Serializable {    private String name;    private String mobile;    private String cityName;    private String createTime;    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getMobile() {        return mobile;    }    public void setMobile(String mobile) {        this.mobile = mobile;    }    public String getCityName() {        return cityName;    }    public void setCityName(String cityName) {        this.cityName = cityName;    }    public String getCreateTime() {        return createTime;    }    public void setCreateTime(String createTime) {        this.createTime = createTime;    }}